import "./App.css";
import { Outlet } from "react-router-dom";
import Cookies from "js-cookie";

function App() {
  cookie = Cookies.set("token", "null", { expires: 1 });
  console.log(cookie);
  return (
    <div className="App">
      <Outlet />
    </div>
  );
}

export default App;
